import { useNavigate } from 'react-router';




const Card = (props) => {
    const navigation = useNavigate()

    const data = props.props
    return (
    <div style={{backgroundColor:"white",marginBottom:"20px",borderRadius:"10px",padding:"15px"}} className="container" onClick={() => {navigation()}}>
        <p style={{fontSize:"20"}}>{data[0]}</p>
    </div>
  )
}

export default Card
